    state = {
        username:'',
        sex: '',
        phonenumber:''    
    }
    render(){
        return(
            <div>
                <div>姓名：</div> <div>{this.state.username}</div>
                <div>性别：</div> <div>{this.state.sex}</div>
                <div>手机号：</div> <div>{this.state.phonenumber}</div>
            </div>
        );
    }
    
}
